/* Returns R, Rc, Patm */
void CKRP(int * ickwrk, double * restrict rckwrk, double * restrict ru, double * restrict ruc, double * restrict pa)
{
     *ru  = 8.31451e+07; 
     *ruc = 1.98721558317399615845; 
     *pa  = 1.01325e+06; 
}


/*Compute P = rhoRT/W(x) */
void CKPX(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double XW = 0;/* To hold mean molecular wt */
    XW += x[0]*2.015940; /*H2 */
    XW += x[1]*1.007970; /*H */
    XW += x[2]*15.999400; /*O */
    XW += x[3]*31.998800; /*O2 */
    XW += x[4]*17.007370; /*OH */
    XW += x[5]*18.015340; /*H2O */
    XW += x[6]*33.006770; /*HO2 */
    XW += x[7]*34.014740; /*H2O2 */
    XW += x[8]*12.011150; /*C */
    XW += x[9]*13.019120; /*CH */
    XW += x[10]*14.027090; /*CH2 */
    XW += x[11]*14.027090; /*CH2(S) */
    XW += x[12]*15.035060; /*CH3 */
    XW += x[13]*16.043030; /*CH4 */
    XW += x[14]*28.010550; /*CO */
    XW += x[15]*44.009950; /*CO2 */
    XW += x[16]*29.018520; /*HCO */
    XW += x[17]*30.026490; /*CH2O */
    XW += x[18]*31.034460; /*CH2OH */
    XW += x[19]*31.034460; /*CH3O */
    XW += x[20]*32.042430; /*CH3OH */
    XW += x[21]*25.030270; /*C2H */
    XW += x[22]*26.038240; /*C2H2 */
    XW += x[23]*27.046210; /*C2H3 */
    XW += x[24]*28.054180; /*C2H4 */
    XW += x[25]*29.062150; /*C2H5 */
    XW += x[26]*30.070120; /*C2H6 */
    XW += x[27]*41.029670; /*HCCO */
    XW += x[28]*42.037640; /*CH2CO */
    XW += x[29]*42.037640; /*HCCOH */
    XW += x[30]*14.006700; /*N */
    XW += x[31]*15.014670; /*NH */
    XW += x[32]*16.022640; /*NH2 */
    XW += x[33]*17.030610; /*NH3 */
    XW += x[34]*29.021370; /*NNH */
    XW += x[35]*30.006100; /*NO */
    XW += x[36]*46.005500; /*NO2 */
    XW += x[37]*44.012800; /*N2O */
    XW += x[38]*31.014070; /*HNO */
    XW += x[39]*26.017850; /*CN */
    XW += x[40]*27.025820; /*HCN */
    XW += x[41]*28.033790; /*H2CN */
    XW += x[42]*41.032520; /*HCNN */
    XW += x[43]*43.025220; /*HCNO */
    XW += x[44]*43.025220; /*HOCN */
    XW += x[45]*43.025220; /*HNCO */
    XW += x[46]*42.017250; /*NCO */
    XW += x[47]*28.013400; /*N2 */
    XW += x[48]*39.948000; /*AR */
    XW += x[49]*43.089240; /*C3H7 */
    XW += x[50]*44.097210; /*C3H8 */
    XW += x[51]*43.045610; /*CH2CHO */
    XW += x[52]*44.053580; /*CH3CHO */
    *P = *rho * 8.31451e+07 * (*T) / XW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*H2 */
    YOW += y[1]*imw[1]; /*H */
    YOW += y[2]*imw[2]; /*O */
    YOW += y[3]*imw[3]; /*O2 */
    YOW += y[4]*imw[4]; /*OH */
    YOW += y[5]*imw[5]; /*H2O */
    YOW += y[6]*imw[6]; /*HO2 */
    YOW += y[7]*imw[7]; /*H2O2 */
    YOW += y[8]*imw[8]; /*C */
    YOW += y[9]*imw[9]; /*CH */
    YOW += y[10]*imw[10]; /*CH2 */
    YOW += y[11]*imw[11]; /*CH2(S) */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*CO */
    YOW += y[15]*imw[15]; /*CO2 */
    YOW += y[16]*imw[16]; /*HCO */
    YOW += y[17]*imw[17]; /*CH2O */
    YOW += y[18]*imw[18]; /*CH2OH */
    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*CH3OH */
    YOW += y[21]*imw[21]; /*C2H */
    YOW += y[22]*imw[22]; /*C2H2 */
    YOW += y[23]*imw[23]; /*C2H3 */
    YOW += y[24]*imw[24]; /*C2H4 */
    YOW += y[25]*imw[25]; /*C2H5 */
    YOW += y[26]*imw[26]; /*C2H6 */
    YOW += y[27]*imw[27]; /*HCCO */
    YOW += y[28]*imw[28]; /*CH2CO */
    YOW += y[29]*imw[29]; /*HCCOH */
    YOW += y[30]*imw[30]; /*N */
    YOW += y[31]*imw[31]; /*NH */
    YOW += y[32]*imw[32]; /*NH2 */
    YOW += y[33]*imw[33]; /*NH3 */
    YOW += y[34]*imw[34]; /*NNH */
    YOW += y[35]*imw[35]; /*NO */
    YOW += y[36]*imw[36]; /*NO2 */
    YOW += y[37]*imw[37]; /*N2O */
    YOW += y[38]*imw[38]; /*HNO */
    YOW += y[39]*imw[39]; /*CN */
    YOW += y[40]*imw[40]; /*HCN */
    YOW += y[41]*imw[41]; /*H2CN */
    YOW += y[42]*imw[42]; /*HCNN */
    YOW += y[43]*imw[43]; /*HCNO */
    YOW += y[44]*imw[44]; /*HOCN */
    YOW += y[45]*imw[45]; /*HNCO */
    YOW += y[46]*imw[46]; /*NCO */
    YOW += y[47]*imw[47]; /*N2 */
    YOW += y[48]*imw[48]; /*AR */
    YOW += y[49]*imw[49]; /*C3H7 */
    YOW += y[50]*imw[50]; /*C3H8 */
    YOW += y[51]*imw[51]; /*CH2CHO */
    YOW += y[52]*imw[52]; /*CH3CHO */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<53; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


