    y[28] = x[28]*42.037640*XWinv; 
    y[29] = x[29]*42.037640*XWinv; 
    y[30] = x[30]*14.006700*XWinv; 
    y[31] = x[31]*15.014670*XWinv; 
    y[32] = x[32]*16.022640*XWinv; 
    y[33] = x[33]*17.030610*XWinv; 
    y[34] = x[34]*29.021370*XWinv; 
    y[35] = x[35]*30.006100*XWinv; 
    y[36] = x[36]*46.005500*XWinv; 
    y[37] = x[37]*44.012800*XWinv; 
    y[38] = x[38]*31.014070*XWinv; 
    y[39] = x[39]*26.017850*XWinv; 
    y[40] = x[40]*27.025820*XWinv; 
    y[41] = x[41]*28.033790*XWinv; 
    y[42] = x[42]*41.032520*XWinv; 
    y[43] = x[43]*43.025220*XWinv; 
    y[44] = x[44]*43.025220*XWinv; 
    y[45] = x[45]*43.025220*XWinv; 
