    /*reaction 79: H + HO2 <=> O + H2O */
    nuki[ 1 * kd + 78 ] += -1 ;
    nuki[ 6 * kd + 78 ] += -1 ;
    nuki[ 2 * kd + 78 ] += +1 ;
