    /*reaction 80: H + HO2 <=> O2 + H2 */
    nuki[ 1 * kd + 79 ] += -1 ;
    nuki[ 6 * kd + 79 ] += -1 ;
    nuki[ 3 * kd + 79 ] += +1 ;
