    qr[287] = sc[14]*sc[35];

    /*reaction 289: O + CH3 => H + H2 + CO */
    qf[288] = sc[2]*sc[12];
    qr[288] = 0.0;

    /*reaction 290: O + C2H4 <=> H + CH2CHO */
    qf[289] = sc[2]*sc[24];
    qr[289] = sc[1]*sc[51];

    /*reaction 291: O + C2H5 <=> H + CH3CHO */
    qf[290] = sc[2]*sc[25];
    qr[290] = sc[1]*sc[52];

    /*reaction 292: OH + HO2 <=> O2 + H2O */
    qf[291] = sc[4]*sc[6];
    qr[291] = sc[3]*sc[5];

    /*reaction 293: OH + CH3 => H2 + CH2O */
