    /*reaction 288: N + CO2 <=> NO + CO */
    kc[287] = exp((g_RT[30] + g_RT[15]) - (g_RT[35] + g_RT[14]));

    /*reaction 289: O + CH3 => H + H2 + CO */
    kc[288] = refC * exp((g_RT[2] + g_RT[12]) - (g_RT[1] + g_RT[0] + g_RT[14]));

