    kc[303] = refC * exp((g_RT[1] + g_RT[52]) - (g_RT[12] + g_RT[0] + g_RT[14]));

    /*reaction 305: OH + CH3CHO => CH3 + H2O + CO */
    kc[304] = refC * exp((g_RT[4] + g_RT[52]) - (g_RT[12] + g_RT[5] + g_RT[14]));

